import React from "react";

const heading = {
  color: "#c5555591",
  textTransform: "capitalize",
  textAlign: "center",
  fontWeight: "bold",
  textShadow: "0px 2px 4px #ffe9c5",
  margin: "70px 0",
  fontFamily: "Josefin Slab, serif",
};
function Heading() {
  return <h1 style={heading}>{`My name is ${fName} ${lName}`}</h1>;
}
export default Heading;
